        <h3 class="titulo_del_modal p-2">¿Qué es el VIN?</h3>
                    <p class="texto_del_modal p-2">
                    El VIN (Vehicle Identification Number) es el número con el cual se 
                    identifican todos los vehiculos de motor posteriores a 1980. En 
                    Clasicar lo usamos para determinar rapidamente el vehiculo
                    que vas a vender
                    </p>
