                        <p class="texto_del_modal p-2">Los lugares más comunes suelen ser:la esquina inferior izquierda
                        del parabrisas, bajo el capó en la cara frontal del motor o en el
                        marco trasero; en el área de chasis sobre la rueda delantera; en
                        el marco de la puerta del conductor (cara interna).</p>    

                        <p class="nota_del_modal p-2" >El VIN además de figurar en el auto, también es informado en los papeles del mismo (título del automotor). </p>
